import styled from 'styled-components';

export const HeaderInner = styled.div`
  display: flex;
  justify-content: space-between; /* 两边对齐 */
`;

export const HeaderLeft = styled.div`
  display: flex;
  justify-content: flex-start;
`;

export const GithubIcon = styled.div`
  font-size: 40;
  display: block;
  padding-top: 10;
  margin-right: 20;
`;
